body, 
html {
    font-size: 18px;
    background: $color1; 
    font-family: 'Fira Sans', sans-serif;
    height: 100%;

    .loading-bg{
        background: white;
        position: fixed;
        top: 0;
        left: 0;
        height: 100vh;
        width: 100vw;
        transform: translate(0, 100%); 
        z-index: 100;
    }

    .logo a{
        text-decoration: none;
        color: white;
    }
}

.menu-icon{
    position: fixed;
    right: 36px;
    top: 36px;
    padding: 20px;
    z-index: 11;

    .fas{
        font-size: 2rem;
        color: black; //$color1;
        cursor: pointer;
    }
}
.primary-btn{
    background: $color1;
    -webkit-border-radius: 30px;
    -moz-border-radius: 30px;
    border-radius: 30px;
    text-align: center;
    color: $color3;
    padding: 15px 30px;
    display: inline-block;
    text-transform: uppercase;
    letter-spacing: 3px;
    // margin-right: 15px;
    text-decoration: none;
    letter-spacing: 3px;
    transition: $btnTransition;
    &:hover{
        border-color: $hoverColor;
        background: $hoverColor;
        color: $color1;
        font-size: 1.5rem;
    }
}

.primary-btn, .ghost-btn{
    margin-right: 15px;
    margin-bottom: 20px;
}

.ghost-btn{
    border: 4px solid $color1;
    -webkit-border-radius: 30px;
    -moz-border-radius: 30px;
    border-radius: 30px;
    text-align: center;
    color: $color1;
    padding: 12px 27px;
    display: inline-block;
    text-transform: uppercase;
    letter-spacing: 3px;
    text-decoration: none;
    letter-spacing: 3px;
    transition: $btnTransition;
    &:hover{
        border-color: $hoverColor;
        color: $color1;
        font-size: 1.5rem;

    }

}

#menu{
    background: $color1; 
    position: fixed;
    width: 100%;
    top: 0;
    bottom: 0;
    transform: translate3d(-100%,0,0);
    z-index: 10;
    display: flex;
    align-items: center;
    justify-content: center;
    opacity: 1;
    transition: all .5s ease-in-out;

    nav{
        width: 400px;
        text-align: center;
    }
    a{
        font-size: 2.3rem;
        padding: 1rem;
        display: block;
        text-decoration: none;
        color: white;
        &:hover{
            color: $color5;
        }
    }
}

.menu-active{
    .menu-icon{
        .fas {
            color: white;
        }
    }
   #menu{
    width: 100%;
    top: 0;
    bottom: 0;
    transform: translate3d(0,0,0)
   }
} 

.scroll-section{
    height: 100vh; 
    overflow-y: scroll;
    overflow-x: hidden;
    padding: 56px;

}

